import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Button from '@mui/material/Button';

function Track({ track, onAddTrack, onRemoveTrack, isRemovable }) {
  const handleAddClick = () => {
    onAddTrack(track);
  };

  const handleRemoveClick = () => {
    onRemoveTrack(track);
  };

  return (
    <ListItem className="track" key={track.id}>
      <ListItemText primary={track.name} secondary={`${track.artist} | ${track.album}`} />
      {isRemovable ? (
        <Button variant="contained" color="secondary" onClick={handleRemoveClick}>
          REMOVE
        </Button>
      ) : (
        <Button variant="contained" color="primary" onClick={handleAddClick}>
          ADD
        </Button>
      )}
    </ListItem>
  );
}

export default Track;
